import { MenuButton, NavLink, NavMenu, SidebarWrapper } from "../../styles/Sidebar.styles"

const Sidebar = ():JSX.Element => {
    return (
        <SidebarWrapper>
            <NavMenu>
                <NavLink href='/feed'><MenuButton className='btn btn-outline-light btn-1'></MenuButton></NavLink>
            </NavMenu>
        </SidebarWrapper>
    )
}

export default Sidebar
